pragma solidity ^0.4.23;
pragma experimental ABIEncoderV2;

import "../util/TokenReceiver.sol"; 
import "../util/TrackedRequire.sol";
import "../interfaces/IVoteController.sol";
import "../interfaces/IVoteOrigin.sol";
import "../interfaces/IParameterSource.sol";
import "./VoteStorage.sol";
import "./VotePayout.sol";

contract PublicVoteController is TokenReceiver, TrackedRequire, IVoteController { 
    event VoteStarted(uint voteId, address challenger);
    event VoteCast(uint voteId, address voter, uint256 stake);
    event VoteIncreased(uint voteId, address voter, uint256 increasedBy);
    event VoteEnded(uint voteId, IVoteController.Candidate winner);
    event VoteDistributed(uint voteId, IVoteController.Candidate winner);

    PublicVoteStorage.Data private voteData;

    constructor(address _parameterSource) public 
        TokenReceiver(IParameterSource(_parameterSource).getAddress("CORE", "TOKEN")) 
    {
    }

    function getStyleName() public pure returns (string _style) { 
        return "PUBLIC";
    }

    function forceExpire(uint _voteId) public returns (bool _success) { 
        return PublicVoteStorage.forceExpire(voteData, _voteId);
    }

    function voteExists(uint _voteId) public view returns (bool _exists) { 
        return PublicVoteStorage.exists(voteData, _voteId);
    }

    function voteActive(uint _voteId) public view returns (bool _active) { 
        return PublicVoteStorage.active(voteData, _voteId);
    }

    function getConfig(uint _voteId) public view 
        returns (uint, uint, uint, uint, uint256, uint256)
    {
        IVoteController.VoteConfiguration storage config = voteData.votes[_voteId].configuration;

        return (
            config.challengePenalty,
            config.votePenalty,
            config.challengeLength,
            config.challengeDistribution,
            config.minVoteStake,
            config.minVoteIncrementalStake
        );
    }


    function getStatus(uint _voteId) public view 
        returns (uint, address, address, string, string, uint256, uint256) 
    {
        PublicVoteStorage.Vote storage voteItem = voteData.votes[_voteId];

        return (
            voteItem.expirationTimestamp,
            voteItem.incumbent.owner,
            voteItem.challenger.owner, 
            voteItem.incumbent.value,
            voteItem.challenger.value,
            voteItem.incumbent.totalVoteValue,
            voteItem.challenger.totalVoteValue
        );
    }


    function beginVote(IVoteController.VoteDescriptor memory _descriptor) public returns (bool _success, uint id) { 
        _require(_unattributedTokenValue() > 0, "There must be unattributed tokens associatd with this contract");

        IVoteOrigin origin = IVoteOrigin(msg.sender);
        // Check if a vote is pending 
        _require(origin.isVotePending(_descriptor.key), "Origin vote source must be flagged as pending for key");

        // Attribute incoming tokens to the challengers
        _attributeUnowned(_descriptor.incumbent.owner, _descriptor.incumbent.stake);
        _attributeUnowned(_descriptor.challenger.owner, _descriptor.challenger.stake);

        // Create a vote id
        uint voteId = PublicVoteStorage.create(voteData, _descriptor);
        return (true, voteId); 
    }

    function vote(uint _voteId, IVoteController.Candidate _candidate, uint256 _stake) public returns (bool _success) { 

        _require(voteActive(_voteId), "Vote must be active to vote.");
        _require(_depositHere(_stake), "Voting stake deposit must be successful.");

        _require(PublicVoteStorage.pushVote(voteData, _voteId, _candidate, _stake), "Push vote must succeed");

        emit VoteCast(_voteId, msg.sender, _stake);

        return true;
    }

    function increaseVote(uint _voteId, uint256 _additionalStake) public returns (bool _success) { 

        _require(voteActive(_voteId), "Vote must be active to increase voting stake.");
        _require(_depositHere(_additionalStake), "Deposit of additional stake must be successful.");

        _require(PublicVoteStorage.increaseVote(voteData, _voteId, _additionalStake), "Increase vote must succeed");

        emit VoteIncreased(_voteId, msg.sender, _additionalStake);
        return true; 
    }

    function process(uint _voteId) public returns (bool _success) { 
        _require(voteExists(_voteId), "Vote must exist to process it.");

        PublicVoteStorage.Vote storage voteItem = voteData.votes[_voteId];

        // Vote is still active 
        if(voteItem.expirationTimestamp > block.timestamp) { 
            return false; 
        }

        // Vote is due to close, find the winner 
        IVoteController.Candidate winner = IVoteController.Candidate.Incumbent; 
        IVoteController.Candidate loser = IVoteController.Candidate.Challenger;

        // **NOTE** Tie means incumbent wins
        if(voteItem.challenger.totalVoteValue > voteItem.incumbent.totalVoteValue) { 
            winner = IVoteController.Candidate.Challenger;
            loser = IVoteController.Candidate.Incumbent;
        }

        voteItem.winner = winner;
        voteItem.loser = loser;

        emit VoteEnded(_voteId, winner);

        return true;
    }

    function distributeVoteResult(uint _voteId) public returns (bool _success) { 
        _require(voteExists(_voteId), "Vote must exist"); 
        _require(!voteActive(_voteId), "Vote must not be active"); 

        PublicVoteStorage.Vote storage voteItem = voteData.votes[_voteId];

        // NOTE: High gas function, processing split from distribution
        _require(voteItem.winner != IVoteController.Candidate.None, "Has valid winner");
        _require(voteItem.loser != IVoteController.Candidate.None, "Has valid loser");

        PublicVoteStorage.VoteCandidate storage winners = voteData.votes[_voteId].incumbent;
        PublicVoteStorage.VoteCandidate storage losers = voteData.votes[_voteId].challenger;

        if(voteItem.winner == IVoteController.Candidate.Challenger) { 
            losers = winners;
            winners = voteData.votes[_voteId].challenger;
        }

        // Transfer the winners *item* stake back to the origin contract, and transfer
        // ownership if needed 
        _require(voteItem.origin != address(0), "Vote has valid origin address");
        IVoteOrigin origin = IVoteOrigin(voteItem.origin);

        // Move deposit to be owned by voting contract
        _transferDeposit(winners.owner, voteItem.origin, winners.ownerStakeValue);
        _withdrawTo(voteItem.origin, winners.ownerStakeValue);

        // Call into the origin contract to assign the item to the winner.
        _require(origin.assignVoteOutcome(_voteId, voteItem.key, winners.owner, winners.value, winners.ownerStakeValue), "Assign vote outcome must succeed");

        _require(true, "BREAK HERE 1");
        uint256 challengePot = _distributeVoteOwners(voteItem.configuration, losers, winners);

        // Take voting fee from all loser voters and add to pot. 
        uint256 votersPot = _taxLosingVoters(voteItem.configuration, losers);
        uint256 finalPot = challengePot.add(votersPot);

        _rewardWinningVoters(winners, finalPot);

        // PublicVoteStorage.deleteVote(voteData, _voteId);
        emit VoteDistributed(_voteId, voteItem.winner);

        PublicVoteStorage.deleteVote(voteData, _voteId);

        return true; 
    }


    function _distributeVoteOwners(
        IVoteController.VoteConfiguration storage configuration, 
        PublicVoteStorage.VoteCandidate storage loser, 
        PublicVoteStorage.VoteCandidate storage winner
    ) 
        private returns (uint256 pot) 
    {
        _require(loser.ownerStakeValue > 0, "Loser must have stake");
        _require(winner.ownerStakeValue > 0, "Winner must have stake");

        uint256 loserFee = VotePayout.calcFraction(loser.ownerStakeValue, configuration.challengePenalty, 100);

        _require(loserFee <= loser.ownerStakeValue, "Fee must be less than stake");

        // How much does the winner get vs the voting pot? 
        uint256 winnerKeeps = VotePayout.calcFraction(loserFee, configuration.challengeDistribution, 100);

        _require(winnerKeeps <= loser.ownerStakeValue, "Winner reward must be less than loser stake");

        uint256 votingPot = loserFee.sub(winnerKeeps);
        uint256 loserKeeps = loser.ownerStakeValue - loserFee;

        // Divide up the loser fee, winner takes thier %, contract takes the pot %
        _transferDeposit(loser.owner, winner.owner, winnerKeeps);
        _transferDeposit(loser.owner, address(this), votingPot);

        // Refund the loser
        if(loserKeeps > 0) { 
            _withdrawTo(loser.owner, loserKeeps);
        }

        // Reward the winner
        _withdrawTo(winner.owner, winnerKeeps);

        return votingPot;
    }

    function _taxLosingVoters(IVoteController.VoteConfiguration storage configuration, PublicVoteStorage.VoteCandidate storage loser) private 
        returns (uint256 pot) 
    { 
        uint256 votingPot = 0;

        for(uint i = 0; i < loser.voters.length; i++) { 
            uint256 loserVoterAmount = loser.voteValues[loser.voters[i]];

            uint256 loserVoteFee = VotePayout.calcFraction(loserVoterAmount, configuration.votePenalty, 100);
            uint256 loserVoteKeeps = loserVoterAmount - loserVoteFee;

            _withdrawTo(loser.voters[i], loserVoteKeeps);
            _transferDeposit(loser.voters[i], address(this), loserVoteFee);
            votingPot = votingPot.add(loserVoteFee);

            delete loser.voteValues[loser.voters[i]];
        }

        return votingPot;
    }

    function _rewardWinningVoters(PublicVoteStorage.VoteCandidate storage winner, uint256 _pot) private returns (uint256 pot) { 
        // TODO: Yin Yin Review
        // EDGE CASE: No voters, but distribution set. This should go all to the winner

        if(winner.voters.length == 0) { 
            _transferDeposit(address(this), winner.owner, _pot);
            _withdrawTo(winner.owner, _pot);
            return 0;
        }

        uint256 runningPot = _pot;

        // Disribute winners share
        for(uint j = 0; j < winner.voters.length; j++) {
            uint256 winnerVoterAmount = winner.voteValues[winner.voters[j]];

            uint256 share = VotePayout.percent(winnerVoterAmount, winner.voteValue, 10000);
            uint256 reward = VotePayout.calcFraction(_pot, share, 10000);

            _require(reward <= pot, "Reward must be less than pot"); 

            runningPot = runningPot.sub(reward);

            _require(runningPot >= 0, "Pot must be large enough"); 

            _transferDeposit(address(this), winner.voters[j], reward);
            _withdrawTo(winner.voters[j], reward);
            delete winner.voteValues[winner.voters[j]];
        }

        return runningPot;
    }
}
